contentType\":\"Image\",\"license\":\"U\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":19.67799642218247,\"y\":3.5337686936363895,\"width\":61.46583184257603,\"height\":39.99802108953156,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"font-size:2.25em\\\"><strong><span style=\\\"color:#e74c3c\\\">The Free Surface of Liquids</span></strong></span></p>\\n\"},\"subContentId\":\"87df3b99-5bdc-4a2f-956c-3ebfd1f18c2b\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.7889087656529516,\"y\":24.736380855454726,\"width\":57.24508050089445,\"height\":53.00653040454584,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"font-size:1.5em\\\">What is the free surface of a liquid?</span></p>\\n\\n<p><br />\\n<span style=\\\"font-size:1.5em\\\">A liquid is in contact with the wall of the container it is in but also with air. The liquid surface in contact with air is called \\\"<em><strong><span style=\\\"color:#e74c3c\\\">the free surface of a liquid </span></strong></em>\\\".</span><br />\\n </p>\\n\"},\"subContentId\":\"253be2c6-36be-455a-b46a-b5caf1b67e2d\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":2.200704225352113,\"y\":2.608264721480799,\"width\":63.897763578274756,\"height\":97.29468192527769,\"action\":{\"library\":\"H5P.MultiChoice 1.16\",\"params\":{\"media\":{\"disableImageZooming\":false},\"answers\":[{\"correct\":false,\"tipsAndFeedback\":{\"chosenFeedback\":\"<div>Observe the surface of water in contact with air only, is it different in the three beakers?</div>\\n\",\"tip\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>The free surface of the liquid depends on the position of the container.</div>\\n\"},{\"correct\":true,\"tipsAndFeedback\":{\"chosenFeedback\":\"<div>Correct! The free surface of a liquid at rest <strong>remains plane and horizontal regardless of the container's position</strong>. This is primarily due to the atmospheric pressure (pressure of air) that is equal throughout the whole surface in contact with air.</div>\\n\",\"tip\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>The free surface of the liquid is always plane (flat) and horizontal.</div>\\n\"},{\"correct\":false,\"tipsAndFeedback\":{\"tip\":\"\",\"chosenFeedback\":\"<div>Observe the surface of water in contact with air only ignoring the position of the container.</div>\\n\",\"notChosenFeedback\":\"\"},\"text\":\"<div>The free surface of the liquid is oblique at times and horizontal at others.</div>\\n\"}],\"overallFeedback\":[{\"from\":0,\"to\":100}],\"behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":true,\"enableCheckButton\":true,\"type\":\"auto\",\"singlePoint\":false,\"randomAnswers\":true,\"showSolutionsRequiresInput\":true,\"confirmCheckDialog\":false,\"confirmRetryDialog\":false,\"autoCheck\":false,\"passPercentage\":100,\"showScorePoints\":true},\"UI\":{\"checkAnswerButton\":\"Check\",\"showSolutionButton\":\"Show solution\",\"tryAgainButton\":\"Retry\",\"tipsLabel\":\"Show tip\",\"scoreBarLabel\":\"Score\",\"tipAvailable\":\"Tip available\",\"feedbackAvailable\":\"Feedback available\",\"readFeedback\":\"Read feedback\",\"wrongAnswer\":\"Wrong answer\",\"correctAnswer\":\"Correct answer\",\"shouldCheck\":
